function PzSidenavSet(props) {
    return(
        <div>
          <HeaderContainer>
              <SideNav
              aria-label="Side navigation"
              isRail
              expanded={isSideNavExpanded}
              onOverlayClick={onClickSideNavExpand}>
              <SideNavItems>
                <SideNavMenu renderIcon={Fade16} title="1 Category title" href="javascript:void(0)">
                </SideNavMenu>
                <SideNavMenu renderIcon={Fade16} title="2 Category title" href="javascript:void(0)">
